/*Table structure for table `tb_spare_office` */

DROP TABLE IF EXISTS `tb_spare_office`;

CREATE TABLE `tb_spare_office` (
  `id_spare_office` int(11) NOT NULL AUTO_INCREMENT,
  `id_office` int(11) NOT NULL,
  `id_spare` int(11) NOT NULL,
  `id_sn` int(11) NOT NULL,
  `id_status_spare` int(11) NOT NULL,
  PRIMARY KEY (`id_spare_office`),
  KEY `SpareOfficeAndOffice` (`id_office`),
  KEY `SpareOfficeAndSpare` (`id_spare`),
  KEY `SpareOfficeAndSerialnumber` (`id_sn`),
  KEY `SpareOfficeAndStatus` (`id_status_spare`),
  CONSTRAINT `SpareOfficeAndOffice` FOREIGN KEY (`id_office`) REFERENCES `tb_office` (`id_office`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `SpareOfficeAndSerialnumber` FOREIGN KEY (`id_sn`) REFERENCES `tb_sn_spare` (`id_sn`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `SpareOfficeAndSpare` FOREIGN KEY (`id_spare`) REFERENCES `tb_spare` (`id_spare`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `SpareOfficeAndStatus` FOREIGN KEY (`id_status_spare`) REFERENCES `tb_status_spare` (`id_status_spare`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

